const zigbeeHerdsmanConverters = require('zigbee-herdsman-converters');
const zigbeeHerdsmanUtils = require('zigbee-herdsman-converters/lib/utils');

const fz = zigbeeHerdsmanConverters.fromZigbeeConverters || zigbeeHerdsmanConverters.fromZigbee;
const tz = zigbeeHerdsmanConverters.toZigbeeConverters || zigbeeHerdsmanConverters.toZigbee;

const exposes = (zigbeeHerdsmanConverters.hasOwnProperty('exposes'))?zigbeeHerdsmanConverters.exposes:require("zigbee-herdsman-converters/lib/exposes");

const ea = exposes.access;
const e = exposes.presets;

const reporting = require('zigbee-herdsman-converters/lib/reporting');

const ZCL_DATATYPE_UINT16 = 0x21;

const ACCESS_STATE = 0b001, ACCESS_WRITE = 0b010, ACCESS_READ = 0b100;

const fz_local = {
    soil_moisture_config: {
        cluster: 'msSoilMoisture',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0202)) {
                result.threshold = msg.data[0x0202];
            }
            if (msg.data.hasOwnProperty(0x0203)) {
                result.interval = msg.data[0x0203];
            }
            return result;
        },
    },
};

const tz_local = {
    soil_moisture_config: {
        key: ['threshold', 'interval'],
        convertSet: async (entity, key, value, meta) => {
            value *= 1;
            const firstEndpoint = meta.device.getEndpoint(1);
            const payloads = {
                threshold: ['msSoilMoisture', {0x0202: {value, type: ZCL_DATATYPE_UINT16}}],
                interval: ['msSoilMoisture', {0x0203: {value, type: ZCL_DATATYPE_UINT16}}],
            };
            await firstEndpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: value},
            };
        },
        convertGet: async (entity, key, meta) => {
            const firstEndpoint = meta.device.getEndpoint(1);
            const payloads = {
                threshold: ['msSoilMoisture', 0x0202],
                interval: ['msSoilMoisture', 0x0203],
            };
            await firstEndpoint.read(payloads[key][0], [payloads[key][1]]);
        },
    },
};

const device = {
    zigbeeModel: ['Flower_Sensor_v2'],
    model: 'Flower_Sensor_v2',
    vendor: 'Bacchus',
    description: 'Flower soil moisture sensor',
    supports: '',
    fromZigbee: [
        fz.temperature, 
        fz.humidity, 
        fz.illuminance, 
        fz.battery,
        fz.soil_moisture,
        fz.on_off,
        fz_local.soil_moisture_config,
    ],
    toZigbee: [
        tz.factory_reset,
        tz_local.soil_moisture_config,
    ],
    meta: {
        configureKey: 1,
        disableDefaultResponse: true,
    },
    configure: async (device, coordinatorEndpoint, logger) => {
        const firstEndpoint = device.getEndpoint(1);
        await reporting.bind(firstEndpoint, coordinatorEndpoint, ['genPowerCfg', 'msTemperatureMeasurement', 'msIlluminanceMeasurement', 'msSoilMoisture', 'genOnOff']);
        const overrides = { min: 0, max: 3600, change: 0 };
        await reporting.batteryVoltage(firstEndpoint, overrides);
        await reporting.batteryPercentageRemaining(firstEndpoint, overrides);
        await reporting.temperature(firstEndpoint, overrides);
        await reporting.soil_moisture(firstEndpoint, overrides);
        await reporting.illuminance(firstEndpoint, overrides);
        await reporting.onOff(firstEndpoint, overrides);

        await firstEndpoint.read('msSoilMoisture', [0x0202]);
        await firstEndpoint.read('msSoilMoisture', [0x0203]);

},
    exposes: [
        e.battery(), 
        e.battery_voltage(),
        e.illuminance(), 
        e.illuminance_lux(), 
        e.soil_moisture(), 
        e.temperature(),
        e.numeric('threshold', ea.STATE_SET).withValueMin(0).withValueMax(100).withDescription('Minimum soil moisture for binding'),
        e.numeric('interval', ea.STATE_SET).withUnit('min').withValueMin(0).withValueMax(600).withDescription('Reporting interval'),
    ],
icon: 'data:image/jpg;base64,',
};

module.exports = device;
